reviewText:
Your satisfaction with this device depends on what you're hoping for.  It will disappoint as a substitute for really expensive hardware, and won't meet the requirements of most artists.

It IS an alternative for note taking for me, if imperfect one.  Advantages over pen and paper:
-  weighs 11 ounces (no more than a 80-sheet pad of paper) but stores about 1000 pages;
-  makes it easy to manage, share, and file/archive pages (can connect to any Bluetooth or USB device, and integrates with Evernote);
-  has a smaller carbon footprint than paper (uses almost no power, and sacrifices no trees, and can operate for years);

On the other hand, downsides compared with pen and paper:
-  Slipperier to write on (though this device beats a stylus on a tablet or phone);
-  Black and white only and the display offers limited contrast (though saved images are crisp black and white);
-  Less ability to vary line thickness than a good pen on paper;
-  I can write only about half as much per page as I'd put onto a standard size sheet of paper;
-  Can record only using the stylus, which is pricey to replace if lost (the tablet stores it securely);
-  Can't recall a saved image to the device display (which would be nice for reference or adding more info).

So as an atternative to pen and paper there are pros and cons; the pros have it for me but the cons could be the bigger factor for some.  On the other hand, for some the alternative is taking notes with a stylus on a tablet, touchscreen laptop, or phone.  If this is you, consider this product's several advantages:
-  Instant feedback like pen on paper (no "lag" between drawing a line and seeing it)
-  Feels more like writing on paper;
-  Easier to read in bright light, even out of doors
-  Uses much less power (can go a week between charges in regular use);
-  Thinner and lighter and more durable but less pricey than those other devices.

Compared with a tablet, touchscreen, or phone, the disadvantages of this device:
-  Can't retrieve a saved note to the screen for reference or amendment;
-  Adds another device to your bag when you're moving about;
-  Can't change colors; can't adjust line width much;
-  Low contrast can be harder to see in low light (like a darkened lecture room).

So once again, what will win one convert will be unworkable for another, depending on how one sees these trade-offs.
